2023 (Short Film) 

When I met @joedaru on the set of Top Gun: Maverick four years ago, we continued our friendship through social media, checking in on each other and cheering each other on from the sidelines. Four years later we finally meet again on set of his short film. 

Such a fun day collaborating with @joedaru, @framed_by _axia, and of course @drfakenstein on this deep fake short comedy. 

